impl Solution {
    pub fn find_champion(grid: Vec<Vec<i32>>) -> i32 {
        let n = grid.len();
        let mut strength_count = vec![0; n];

        for i in 0..n {
            for j in 0..n {
                if grid[i][j] == 1 {
                    strength_count[i] += 1;
                }
            }
        }

        for i in 0..n {
            if strength_count[i] == n - 1 {
                return i as i32;
            }
        }

        -1 // return -1 if no champion is found, though this should not happen given the constraints
    }
}
